By definition, 
\begin{align}
\frac{d^y}{dx^2} &= \frac{d}{dx}\left( \frac{dy}{dx} \right) \\
&= \frac{d}{dt}\left(\frac{dy}{dx}\right) \cdot \frac{dt}{dx} 
\end{align} 

Hence, when $x=t^2$ and $y=t^3$, then 
\begin{align}
\frac{dx}{dt} &= 2t\text{ and } \frac{dy}{dt} = 3t^2 \\
\implies \frac{dy}{dx} &= \dfrac{\frac{dy}{dt}}{\frac{dx}{dt}} = 
\frac{3t^2}{2t} = \frac{3}{2}t \\
\implies \frac{d^2}{dx^2} &= 
\frac{d}{dt}\underbrace{\left( \frac{3}{2}t\right)}_{\frac{dy}{dx}}
\cdot\underbrace{\frac{1}{2t}}_{\frac{dt}{dx}} = \frac{3}{4t}
\end{align} 

But 
\begin{align} 
 \frac{d^2 x}{dt^2} &= 2 \text{ and } \frac{d^2 y}{dt^2} = 6t \\
\implies \dfrac{\frac{d^2x}{dt^2}}{\frac{d^2y}{dt^2}} &= \frac{6t}{2} \\
&= 3t \neq \frac{d}{dt}\left( \frac{dy}{dx}\right) \cdot \frac{dt}{dx}
\end{align}
